import { expect } from "chai";
import { webML } from "../../env/environment";
import { ForgotUsernamePage } from "../../pageobjects/web-v1";
import loginWebV1Page from "../../pageobjects/web-v1/LoginWebV1.page";

describe("Login test", () => {
  const username = "at001";
  const password = "test.123";

  it("Add invalid username", () => {
    webML();
    browser.maximizeWindow();
    loginWebV1Page.usernameInput.addValue("efga");
    loginWebV1Page.passwordInput.addValue("efga");
    loginWebV1Page.signInBtn.addValue("efga");
    expect(loginWebV1Page.invalidUsernameOrPasswordMessage).to.exist;
  });

  it("Add only password", () => {
    loginWebV1Page.passwordInput.addValue("efga");
    expect(loginWebV1Page.invalidUsernameOrPasswordMessage).to.exist;
  });

  it("Open forgot username page", () => {
    loginWebV1Page.forgotUsernameBtn.click();
    const forgotUsernameTitle = $("div*=Forgotten username");
    forgotUsernameTitle.waitForDisplayed();
    expect(forgotUsernameTitle).to.exist;
  });

  it("Verify email error verification icon exists", () => {
    expect(ForgotUsernamePage.infoMessage).to.exist;
    ForgotUsernamePage.sendBtn.click();
    expect(ForgotUsernamePage.emailErrorIcon).to.exist;
  });


  it("Successfull login", () => {
    loginWebV1Page.usernameInput.clearValue();
    loginWebV1Page.passwordInput.clearValue();
    loginWebV1Page.usernameInput.addValue(username);
    loginWebV1Page.passwordInput.addValue(password);
    loginWebV1Page.signInBtn.click();
    const myBetsBtn = $(".header--primary__navigation__thumb--bets");
    expect(myBetsBtn).to.exist;
    myBetsBtn.click();
  });
});

