import { mobileAdministration } from "../../env/environment";
import { verifyIsVisible } from "../../pageobjects/common/Common.page";
import { HomePage, MobileAdminLoginPage } from "../../pageobjects/mobile-administration";

describe("Mobile administration Login tests", () => {

    it("Verify login was successfull, SuperAdmin role", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAd2min");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        HomePage.logoutBtn.click();
        verifyIsVisible(MobileAdminLoginPage.h3Title);
    });

    it("Verify login was successfull, Cashier role", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("cashierqa1");
        MobileAdminLoginPage.passwordInput.addValue("mono.123");
        MobileAdminLoginPage.signInBtn.click();
        HomePage.logoutBtn.click();
        verifyIsVisible(MobileAdminLoginPage.h3Title);

    });

});

