import { administration } from "../../env/environment";
import { default as loginPage } from "../../pageobjects/administration.page/Login.page";
import OrgUser from "../../pageobjects/administration.page/OrganizationUser.page";

describe("Administration - Create org user", () => {
  it("Login", () => {
    administration();
    browser.maximizeWindow();
    loginPage.usernameInput.setValue("DSuperAdminQA");
    loginPage.passwordInput.setValue("mono.123");
    loginPage.signInBtn.click();
  });

  it("Click on Players", () => {
    const PlayersButton = $(
      '[class="quicklinks__btn__icon icomoon icomoon--med icomoon--players"]'
    );
    PlayersButton.click();
  });

  it("Click on New Org User", () => {
    const OrgUserButton = $(
      '[class="icomoon icomoon--med icomoon--user--org"]'
    );
    OrgUserButton.click();
  });

  it("Input data", () => {
    const randomStringNum = String(Math.random()).slice(2, -1);
    OrgUser.usernameInput.addValue(`AT-Operator${randomStringNum}`);

    OrgUser.firstNameInput.addValue("asdf");

    OrgUser.lastNameInput.addValue("asdf");
    OrgUser.emailInput.addValue(`AT@gmail${randomStringNum}.com`);
    OrgUser.passwordInput.setValue("mono.123");
    OrgUser.confirmPasswordInput.setValue("mono.123");

    const RoleButton = $('[class="k-searchbar"]');
    RoleButton.click();
    $(".k-child-animation-container").$("li*=Program Operator").click();
    OrgUser.SaveBtn.click();
  });
});

