import { expect } from "chai";
import { administration } from "../../env/environment";
import { LimitsPage, loginPage, shopPage } from "../../pageobjects/administration.page";
import SideMenuPage from "../../pageobjects/administration.page/SideMenu.page";
import { searchTable, verifyElementValue, verifyIsVisible } from "../../pageobjects/common/Common.page";

describe("Shop Monitoring tests", () => {


    it("Verify shop monitoring page is opepend", () => {
        administration();
        browser.maximizeWindow();
        loginPage.usernameInput.addValue("vikNova");
        loginPage.passwordInput.addValue("mono.123");
        loginPage.signInBtn.click();
        SideMenuPage.FinancesButton.waitForDisplayed();
        browser.url('http://qa.admin.gp.develop/platform/pay-per-day-report?filter=%7B%22filter%22%3A%7B%22accessChannels%22%3A%7B%7D%2C%22parameters%22%3A%5B%5D%7D%2C%22paging%22%3A%7B%22page%22%3A1%2C%22pageSize%22%3A25%7D%7D&page=NaN&pageSize=25&rpp=25');
        const shopCtaMessage = $("h3*=Shop is not selected");
        shopCtaMessage.waitForDisplayed();
        expect(shopCtaMessage).to.exist;
    });

    it("Verify shop is selectable and is opened", () => {
        searchTable("vikiqaa");
        $(".treeview__list").$("span*=VikiQAa").click();
        const title = "h1[title='Shop Monitoring'] > .type--wgt--regular";
        expect(title).to.exist;
        const titleShopName = $("h1[title='Shop Monitoring']").$("span*=VikiQAa");
        verifyIsVisible(titleShopName);
    });

    it("Verify inherit icon is visible", () => {
        // ADD LIMIT ON AGENCY LIMITS PAGE
        browser.url("http://qa.admin.gp.develop/agency/3/organizational-structure-limits");
        LimitsPage.maxStakePerWeekShopInput.addValue("1000");
        $("span=Save").click();
        const succesToastMessage = $("div=Successfully updated");
        verifyIsVisible(succesToastMessage);
        // VERIFY THE INHERIT ICON IS VISIBLE
        browser.url('http://qa.admin.gp.develop/platform/pay-per-day-report?filter=%7B%22filter%22%3A%7B%22accessChannels%22%3A%7B%7D%2C%22parameters%22%3A%5B%5D%7D%2C%22paging%22%3A%7B%22page%22%3A1%2C%22pageSize%22%3A25%7D%7D&page=NaN&pageSize=25&rpp=25');
        searchTable("vikiqaa");
        $(".treeview__list").$("span*=VikiQAa").click();
        const inheritIcon = $(".icomoon--arrow-right--bold");
        verifyIsVisible(inheritIcon);

    });

    it("Remove limit from the limits page", () => {
        // REMOVE THE LIMIT FROM THE LIMITS PAGE
        browser.url("http://qa.admin.gp.develop/agency/3/organizational-structure-limits");
        LimitsPage.maxStakePerWeekShopInput.clearValue();
        $("span=Save").click();
        const succesToastMessage = $("div=Successfully updated");
        verifyIsVisible(succesToastMessage);

        browser.url('http://qa.admin.gp.develop/platform/pay-per-day-report?filter=%7B%22filter%22%3A%7B%22accessChannels%22%3A%7B%7D%2C%22parameters%22%3A%5B%5D%7D%2C%22paging%22%3A%7B%22page%22%3A1%2C%22pageSize%22%3A25%7D%7D&page=NaN&pageSize=25&rpp=25');
        searchTable("vikiqaa");
        $(".treeview__list").$("span*=VikiQAa").click();
        const inheritIcon = $(".icomoon--arrow-right--bold");
        verifyIsVisible(inheritIcon);
    });
});

