import { expect, should } from "chai";
import { administration } from "../../env/environment";
import { SportOfferPage } from "../../pageobjects/administration.page";
import { verifyIsNotVisible, waitForLoader } from "../../pageobjects/common/Common.page";
import LoginPage from "../../pageobjects/administration.page/Login.page";
import SideMenuPage from "../../pageobjects/administration.page/SideMenu.page";

describe("Administration - Sport offer tests", () => {

    it("Open sport offer page", () => {
        administration();
        browser.maximizeWindow();
        LoginPage.usernameInput.addValue('SuperAdmin');
        LoginPage.passwordInput.addValue('B@@sicSup3rAdm1n');
        LoginPage.signInBtn.click();
        SideMenuPage.organizationButton.waitForDisplayed();
        expect(SideMenuPage.organizationButton).to.exist;
        browser.url("http://qa.admin.gp.develop/platform/offer/prematch");
    });

    it("Filter all events, verify events are loaded", () => {
        SportOfferPage.offerEmptyStateTitle.waitForDisplayed();
        expect(SportOfferPage.offerEmptyStateTitle).to.exist;
        SportOfferPage.selectStatus("All");
        SportOfferPage.filterBtn.click();
        waitForLoader();
        const editBtn = $("tbody [role='row']:nth-of-type(1) .icomoon--edit");
        editBtn.waitForClickable();
        expect(editBtn).to.exist;
        verifyIsNotVisible(SportOfferPage.errorPage);

    });

    it("Filter suspended events, verify events are loaded", () => {
        browser.url("http://qa.admin.gp.develop/platform/offer/prematch");
        SportOfferPage.selectStatus("Suspended");
        SportOfferPage.filterBtn.click();
        waitForLoader();
        verifyIsNotVisible(SportOfferPage.errorPage);

    });

    it("Filter Stopped events, verify events are loaded", () => {
        browser.url("http://qa.admin.gp.develop/platform/offer/prematch");
        SportOfferPage.offerEmptyStateTitle.waitForDisplayed();
        SportOfferPage.selectStatus("Stopped");
        SportOfferPage.filterBtn.click();
        waitForLoader();
        verifyIsNotVisible(SportOfferPage.errorPage);
    });

    it("Filter Open events, verify events are loaded", () => {
        browser.url("http://qa.admin.gp.develop/platform/offer/prematch");
        SportOfferPage.offerEmptyStateTitle.waitForDisplayed();
        SportOfferPage.selectStatus("Open");
        SportOfferPage.filterBtn.click();
        waitForLoader();
        verifyIsNotVisible(SportOfferPage.errorPage);
    });

    it("Filter Partially evaluated events, verify events are loaded", () => {
        browser.url("http://qa.admin.gp.develop/platform/offer/prematch");
        SportOfferPage.offerEmptyStateTitle.waitForDisplayed();
        SportOfferPage.selectStatus("Partially evaluated");
        SportOfferPage.filterBtn.click();
        waitForLoader();
        verifyIsNotVisible(SportOfferPage.errorPage);
    });

    it("Filter Evaluated with all betting types, verify events are loaded", () => {
        browser.url("http://qa.admin.gp.develop/platform/offer/prematch");
        SportOfferPage.offerEmptyStateTitle.waitForDisplayed();
        SportOfferPage.selectStatus("Evaluated with all betting types");
        SportOfferPage.filterBtn.click();
        waitForLoader();
        verifyIsNotVisible(SportOfferPage.errorPage);
    });

    it("Filter Cancelled events, verify events are loaded", () => {
        browser.url("http://qa.admin.gp.develop/platform/offer/prematch");
        SportOfferPage.offerEmptyStateTitle.waitForDisplayed();
        SportOfferPage.selectStatus("Cancelled");
        SportOfferPage.filterBtn.click();
        waitForLoader();
        verifyIsNotVisible(SportOfferPage.errorPage);
    });

});

